interface TextFieldBaseProps extends SpectrumTextFieldProps {
  wrapperChildren?: ReactElement | ReactElement[],
  inputClassName?: string,
  multiLine?: boolean,
  labelProps: LabelHTMLAttributes<HTMLLabelElement>,
